import { useState } from 'react';
import { Link } from 'react-router-dom';
import Button from './Button';

const Login = () => {
  return (
    <section className="l-form login">
      <h1 className="form-title">LOGIN</h1>
      <form className="form">
        <div className="form-group">
          <p className="form-label">Email</p>
          <input className="form-field" type="email" name="email"/>
        </div>
        <div className="form-group">
          <p className="form-label">Password</p>
          <input className="form-field" type="password" name="password"/>
        </div>
        <Button title="LOGIN" />
        <p className="account">No account yet? <Link className="account-link" to="/register">REGISTER HERE</Link></p>
      </form>
    </section>
  ) 
}

export default Login;
